import React, { useState, useEffect } from "react";
import "./Gifts.css";
import CategoriesNav from "../categoriesNav/categoriesNav";

const Gifts = () => {
  const [data, setData] = useState([]); 
  const [loading, setLoading] = useState(true); 
  const [error, setError] = useState(null);

 
  const fetchData = async () => {
    try {
      const response = await fetch("https://api.example.com/Gifts"); 
      if (!response.ok) {
        throw new Error("Failed to fetch data");
      }
      const result = await response.json();
      setData(result); 
    } catch (err) {
      setError(err.message); 
    } finally {
      setLoading(false); 
    }
  };

  useEffect(() => {
    fetchData(); 
  }, []);

  return (
    <div className="Gifts">
      <CategoriesNav/>
      <h2 className="Gifts-title">Available Gifts</h2>

      {loading && <p>Loading...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>} 

      <div className="Gifts-container">
        {data.map((gifts) => (
          <div key={gifts.id} className="Gifts-card">
            <img src={gifts.image} alt={gifts.name} className="Gifts-image" />
            <div className="Gifts-content">
              <h3 className="Gifts-name">{gifts.name}</h3>
              <p className="Gifts-description">{gifts.description}</p>
              <p className="Gifts-price">Price: {gifts.price}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Gifts;
